const getEmail = async (state = "hello", action)=>{

    let data = await fetch("http://192.168.1.247:3001/api/user/home")
    .then(reponse => {
        return reponse.json()    
    })
    .then(responseData=>{
        return responseData
    })
    .catch(err=> console.log("error: ", err))

    if(action.type === "EMAIL"){
        console.log(data)
        return "hello"
    }
}

export default getEmail
